
investigacionApp.controller("GenerarDocenteController",["$scope",function(a){a.actividadesInvestigacion=["Investigación Formativa","Asesoria de Tesis","Investigaciones Básicas y Aplicadas","Producción Intelectual"];a.panelGenerados=true;a.panelVer=false;a.panelEditar=false;a.actividad="primer valor";a.panelChange=function(b){if(b==1){a.panelGenerados=true;a.panelVer=false;a.panelEditar=false}else{if(b==2){a.panelGenerados=false;a.panelVer=true;a.panelEditar=false}else{a.panelGenerados=false;a.panelVer=false;a.panelEditar=true}}}}]);